import React, {Component} from 'react';
import './hello.css';

class Hello extends Component {
render(){
    return( 
    <div className="f1 tc">
    <h1>hello world</h1>
    <p>{this.props.greeting}</p>
    </div>
    );
}
}
export default Hello;
